exports=async function(a,b){const{parseCatalog:c}=await require("transcode/parse_catalog"),d=`http://www.jikage.com/book/${a.idPrefix()}/${a}/`;return c(d,[/<div class="book_list">\s*<ul>(?<fragment>(?:\s*<li>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)+)/,/<a href="(?<url>[^"]+)"[^>]*>(?<name>[^<]*)<\/a>/g],{clientOptions:{...(b&&b.clientOptions),encoding:"gbk"}}).then(a=>{const b=a.length-1,c=b-1;let d;for(let e=0;e<a.length&&!(e===b);e++){if(e===c){d=a[e],a[e]=a[e+1],a[e+1]=d;break}if(e===c-1){d=a[e],a[e]=a[e+2],a[e+2]=d;break}d=a[e],a[e]=a[e+3],a[e+3]=d,d=a[e+1],a[e+1]=a[e+2],a[e+2]=d,e+=3;}return a})};